import React from "react";
// Import components
import Todo from "./Todo";

function TodoList( {inputText, todos} ){
  console.log(todos);
  return(
    <div className="todo-container">
      <ul className="todo-list">
        {todos.map}
        <Todo/>
      </ul>
    </div>
  )
}

export default TodoList;
